import React from "react";
import AllyOffersLogo from "../AllyOffersLogo/AllyOffersLogo";
import IconBubbleButton from "../IconBubbleButton/IconBubbleButton";
import MapIconButton from "../MapBubbleButton/MapBubbleButton";
import { useNavigate } from 'react-router-dom';
import PropTypes from 'prop-types';
import styles from './PageHeader.css';

const PageHeader = ({
    showMapButton,
    showBookmarkButton,
    showProfileButton,
}) => {
    const navigate = useNavigate();

    return (
        <div className='header'>
            <div onClick={()=> navigate('/offers')}>
                <AllyOffersLogo/>
            </div>
            <div className='bubble-buttons'>
                <MapIconButton/>
                <IconBubbleButton/>
            </div>
        </div>
    );
};

PageHeader.propTypes = {
    showMapButton: PropTypes.bool,
    showBookmarkButton: PropTypes.bool,
    showProfileButton: PropTypes.bool,
};

export default PageHeader;
